import React from 'react'
import { AnimatePresence, motion } from 'framer-motion'

const PageAnimation = ({ children, initial = {opacity: 0} }) => {
  return (
    <motion.div
      initial={initial}
    >
      {children}
    </motion.div>
  )
}

export default PageAnimation
